function StatisticsList ({ items }){
return(
    <React.Fragment>
        <span className={styles.statListTitle}> Upload stats</span>
        <ul className={styles.statList}>
            {items.map(item => (
                // <li className={styles.statListItem} key={item.id}>
                    <Statistics    
                        // key={item.id}
                        title={item.label} 
                        stats={item.percentage} 
                    />
                // </li>
            ))}
        </ul>
    </React.Fragment>
)
}

